import React, {useState} from 'react';
import { Button, Text } from 'react-native';

const Home = () => {
    const [movies, setMovies] = useState(true);

    return (
        <>
            <Text>Movie Library</Text>
            {movies &&
                <>
                    <Text>Recently Added</Text>
                    {/* <Movie /> */}
                </>
            }




            
            <Text>View By</Text>
            <Button title="Title" />
            <Button title="Genre" />
            <Button title="Actor" />
            <Button title="Format" />


        </>
    );
}

export default Home;
